import React, { Component } from 'react'

export default class AboutUs extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="container m-5">
          <div className="row">
            <div className="col-12">
              <h3>About Us</h3>
              <img src="https://www.lactame.com/github/image-js/image-js/3073b80c7d626196cb669f9d617f491a8338ca66/test/img/taxi/original.jpeg" />
            </div>
          </div>
        </div>

      </React.Fragment>
    )
  }
}
